import axios from 'axios';
import React, { useEffect, useState } from 'react';
import './App.css';

function App() {
  const [movies, setMovies] = useState(null);
  const imagesApi = "https://api.themoviedb.org/3/movie/500/images?api_key=721e6d30945061e57c30f65c44877cf8&language=en-US"

  useEffect(() => {
    axios.get("https://api.themoviedb.org/3/discover/movie?&api_key=721e6d30945061e57c30f65c44877cf8")
      .then(response => {
        console.log(response.data.results);
        setMovies(response.data.results);
      })
  }, [])
  return movies !== null ? (
    <div className="App">
     <ul>
       {
         movies.map((item) => {
         return(
           <div>
             <li key = {item.id}>{item.original_title}</li>
             <img src = {item.imagesApi} alt = "picture" />
           </div>

         ) 
         })
       }
     </ul>

    </div>
  ) : (
      <p>Pas de data</p>
    )
}

export default App;
